selector_to_html = {"a[href=\"#downloading-lists\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Downloading lists<a class=\"headerlink\" href=\"#downloading-lists\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"../how-to/web-interface/download-higher-resolution-images.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">How to download higher resolution versions of images from the web interface<a class=\"headerlink\" href=\"#how-to-download-higher-resolution-versions-of-images-from-the-web-interface\" title=\"Permalink to this heading\">#</a></h1><p>One confusing, and often frustrating, aspect of <a class=\"reference internal\" href=\"../accessing-data/using-web-interface.html#downloading-images-web-interface\"><span class=\"std std-ref\">image downloads via the Trove web interface</span></a> is their resolution. You can use the Trove image viewer to zoom right in to many photographs and manuscripts, enabling you to pick up fine details. But if you download the same image you could find the resolution is much lower. This means you\u2019re limited in how you can use the downloaded image. The available resolutions vary across categories and formats, and you really don\u2019t know what you\u2019ll get until you download it. Many manuscripts, in particular, seem to have low-resolution downloads, which doesn\u2019t help you much when you\u2019re trying to decipher someone\u2019s handwriting!</p><p>Here\u2019s a couple of ways to get higher resolution versions.</p>", "a[href=\"#citation-tab\"]": "<figure class=\"align-default\" id=\"citation-tab\">\n<a class=\"reference internal image-reference\" href=\"../_images/trove-citation-tab.png\"><img alt=\"../_images/trove-citation-tab.png\" src=\"../_images/trove-citation-tab.png\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 14.2 </span><span class=\"caption-text\">Example of the Citation tab with the BibTex option selected</span><a class=\"headerlink\" href=\"#citation-tab\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#bulk-export\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bulk export<a class=\"headerlink\" href=\"#bulk-export\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#table-missing-download-formats\"]": "<table class=\"table\" id=\"table-missing-download-formats\">\n<caption><span class=\"caption-number\">Table 14.2 </span><span class=\"caption-text\">Missing download formats</span><a class=\"headerlink\" href=\"#table-missing-download-formats\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Trove category</p></th>\n<th class=\"head\"><p>Item type</p></th>\n<th class=\"head\"><p>Download format</p></th>\n<th class=\"head\"><p>Note</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p>Newspapers &amp; gazettes</p></td>\n<td><p>page</p></td>\n<td><p>image</p></td>\n<td><p>There\u2019s no option to download a page as an image, just a page image embedded in a PDF.</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Magazines &amp; newsletters</p></td>\n<td><p>article</p></td>\n<td><p>any</p></td>\n<td><p>There\u2019s no option to download individual articles as images, PDFs, or text. While you search for individual articles, the viewer only presents pages. This is different to the newspapers where the viewer presents individual articles.</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"../what-is-trove/trove-web-interface.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">7. </span>The Trove web interface<a class=\"headerlink\" href=\"#the-trove-web-interface\" title=\"Permalink to this heading\">#</a></h1><p>For most users, Trove is defined by its web interface \u2013 by the screens, buttons, boxes, links, and lists you interact with as you navigate around the site. This guide focuses on getting and using the data that sits behind the web interface, but, in some cases, access to data is constrained by the design and functioning of the site. It\u2019s therefore useful to think about the different components of the web interface and how they fit together.</p>", "a[href=\"#table-available-download-options\"]": "<table class=\"table\" id=\"table-available-download-options\">\n<caption><span class=\"caption-number\">Table 14.1 </span><span class=\"caption-text\">Available download options</span><a class=\"headerlink\" href=\"#table-available-download-options\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Trove category</p></th>\n<th class=\"head\"><p>Item type</p></th>\n<th class=\"head\"><p>Download option</p></th>\n<th class=\"head\"><p>Note</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p>Newspapers &amp; gazettes</p></td>\n<td><p>article</p></td>\n<td><p>image</p></td>\n<td><p>The \u2018image\u2019 option actually delivers an HTML page with embedded images. Long articles will often be sliced up in unfortunate ways to \u2018fit\u2019 an A4 page. To get the images themselves you need to extract them from the HTML and try to reassemble them.</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Newspapers &amp; gazettes</p></td>\n<td><p>article</p></td>\n<td><p>PDF</p></td>\n<td></td>\n</tr>\n<tr class=\"row-even\"><td><p>Newspapers &amp; gazettes</p></td>\n<td><p>article</p></td>\n<td><p>text</p></td>\n<td><p>The \u2018text\u2019 option actually delivers an HTML page that includes the publication details as well as the article text. If you just want the plain OCRd text you\u2019d need to extract it from the HTML and remove the publication details.</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Newspapers &amp; gazettes</p></td>\n<td><p>page</p></td>\n<td><p>PDF</p></td>\n<td></td>\n</tr>\n<tr class=\"row-even\"><td><p>Newspapers &amp; gazettes</p></td>\n<td><p>issue</p></td>\n<td><p>PDF</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Books &amp; libraries</p></td>\n<td><p>single page, range of pages, or complete book</p></td>\n<td><p>image</p></td>\n<td><p>Images (single or multiple) are packaged in a zip file with an additional page of copyright information.</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>Books &amp; libraries</p></td>\n<td><p>single page, range of pages, or complete book</p></td>\n<td><p>PDF</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Books &amp; libraries</p></td>\n<td><p>single page, range of pages, or complete book</p></td>\n<td><p>text</p></td>\n<td><p>Unlike the newspapers, this is plain text with no formatting.</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>Books &amp; libraries</p></td>\n<td><p>single page, range of pages, or complete book</p></td>\n<td><p>image</p></td>\n<td><p>Images (single or multiple) are packaged in a zip file with an additional page of copyright information.</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Magazines &amp; newsletters</p></td>\n<td><p>single page, range of pages, or complete issue</p></td>\n<td><p>PDF</p></td>\n<td></td>\n</tr>\n<tr class=\"row-even\"><td><p>Magazines &amp; newsletters</p></td>\n<td><p>single page, range of pages, or complete issue</p></td>\n<td><p>text</p></td>\n<td><p>Unlike the newspapers, this is plain text with no formatting.</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Images, maps, &amp; artefacts</p></td>\n<td><p>single item, range of items</p></td>\n<td><p>image</p></td>\n<td><p>Images are packaged in a zip file with an additional page of copyright information. As well as the standard JPEG format, some maps include an option to download high-resolution TIFF files.</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>Images, maps, &amp; artefacts</p></td>\n<td><p>single item, range of items</p></td>\n<td><p>PDF</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Images, maps, &amp; artefacts</p></td>\n<td><p>collection</p></td>\n<td><p>image</p></td>\n<td><p>A maximum of 20 images can be downloaded at one time.</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>Images, maps, &amp; artefacts</p></td>\n<td><p>collection</p></td>\n<td><p>PDF</p></td>\n<td><p>A maximum of 20 images can be included in the PDF.</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Diaries, letters &amp; archives</p></td>\n<td><p>single page, range of pages</p></td>\n<td><p>image</p></td>\n<td><p>Images are packaged in a zip file with an additional page of copyright information.</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>Diaries, letters &amp; archives</p></td>\n<td><p>single page, range of pages</p></td>\n<td><p>PDF</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Diaries, letters &amp; archives</p></td>\n<td><p>collection</p></td>\n<td><p>image</p></td>\n<td><p>Images are packaged in a zip file with an additional page of copyright information.</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>Diaries, letters &amp; archives</p></td>\n<td><p>collection</p></td>\n<td><p>PDF</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Music, audio &amp; video</p></td>\n<td><p>oral history interview transcript</p></td>\n<td><p>text</p></td>\n<td></td>\n</tr>\n<tr class=\"row-even\"><td><p>Music, audio &amp; video</p></td>\n<td><p>oral history interview transcript</p></td>\n<td><p>PDF</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Music, audio &amp; video</p></td>\n<td><p>oral history interview</p></td>\n<td><p>audio recording</p></td>\n<td><p>MP3 files available at a variety of bitrates (the higher the bitrate, the larger the file), eg: 48kbps, 128kbps, and 256kbps</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"#download-tab\"]": "<figure class=\"align-default\" id=\"download-tab\">\n<a class=\"reference internal image-reference\" href=\"../_images/web-download-example.png\"><img alt=\"../_images/web-download-example.png\" src=\"../_images/web-download-example.png\" style=\"width: 300px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 14.1 </span><span class=\"caption-text\">Example of the download tab in the digitised magazines and newsletters viewer</span><a class=\"headerlink\" href=\"#download-tab\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#download-metadata-using-citations-and-bibtex\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Download metadata using citations and BibTex<a class=\"headerlink\" href=\"#download-metadata-using-citations-and-bibtex\" title=\"Permalink to this heading\">#</a></h2><p>BibTex is a <a class=\"reference external\" href=\"https://www.bibtex.org/Format/\">file format</a> used to save structured information about references, and is used by many tools to manage citations and build bibliographies. You can download item metadata in BibTex format using Trove\u2019s \u2018Citation\u2019 tab.</p><p>In the main search interface, the \u2018Citation\u2019 tab includes a BibTex option. You can copy or download the BibTex record.</p>", "a[href=\"#downloading-data-from-the-trove-web-interface\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">14.1. </span>Downloading data from the Trove web interface<a class=\"headerlink\" href=\"#downloading-data-from-the-trove-web-interface\" title=\"Permalink to this heading\">#</a></h1><p>See <a class=\"reference internal\" href=\"../what-is-trove/trove-web-interface.html\"><span class=\"doc std std-doc\">The Trove web interface</span></a> for a overview of the different components that make up the web interface. In particular, it\u2019s important to understand the difference between the main search interface and the digitised item viewers.</p>", "a[href=\"#downloading-images-pdfs-text-and-audio\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Downloading images, PDFs, text, and audio<a class=\"headerlink\" href=\"#downloading-images-pdfs-text-and-audio\" title=\"Permalink to this heading\">#</a></h2><p>Items that have been digitised by the NLA and made available through one of Trove\u2019s digitised item viewers can usually be downloaded in a variety of formats. This includes newspapers, books, journals, images, maps, manuscripts, and oral histories.</p><p>The official Trove Help includes a page on <a class=\"reference external\" href=\"https://trove.nla.gov.au/help/using-trove/downloading\">Downloading</a> that describes the options available in the various Trove categories for downloading images, PDFs, text, and audio. Different formats have different viewers, but generally speaking you just need to find the download tab in the sidebar, select a format, and click the button.</p>", "a[href=\"#newspaper-citation-tab\"]": "<figure class=\"align-default\" id=\"newspaper-citation-tab\">\n<a class=\"reference internal image-reference\" href=\"../_images/newspaper-citation-options.png\"><img alt=\"../_images/newspaper-citation-options.png\" src=\"../_images/newspaper-citation-options.png\" style=\"width: 300px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 14.3 </span><span class=\"caption-text\">Options for downloading newspaper citations</span><a class=\"headerlink\" href=\"#newspaper-citation-tab\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
